import './App.css';
import {useState} from "react"
import axios from 'axios'

function App() {
  return (
    <>
    <div >
      <ul className="nav">
        <li>About</li>
        <li>Instructions</li>
        <li>Request a Chemical</li>
      </ul>
    </div>
    <div className="middle">
      <h2 className="title">Organic Chem Database</h2>
    </div>
    <div>
      <label>Search</label>
    </div>
    </>
  );
}

export default App;
